Creating a Discord bot with a single slash command to ban users is a good way to introduce the concept of slash commands to your Discord server. Below is an example of how you can create such a bot using `discord.js` v14.

### Prerequisites

- A running Discord server.
- Node.js installed on your machine.
- The necessary permissions to add bots to the server.

### Step-by-Step Guide

1. **Create a new directory for your project:**

    ```bash
    mkdir discord-ban-bot
    cd discord-ban-bot
    ```

2. **Initialize a new Node.js project:**

    ```bash
    npm init -y
    ```

3. **Install required packages:**

    ```bash
    npm install discord.js@14
    ```

4. **Create the main bot file (`index.js`):**

    ```javascript
    const { Client, GatewayIntentBits } = require('discord.js');
    const { REST } = require('@discordjs/rest');
    const fs = require('fs');

    const clientId = 'YOUR_BOT_ID';
    const guildId = 'YOUR_GUILD_ID';
    const token = 'YOUR_BOT_TOKEN';

    const client = new Client({ intents: [GatewayIntentBits.Guilds, GatewayIntentBits.GuildMessages, GatewayIntentBits.MessageContent] });

    const commandsPath = './commands'; // Path where you'll store your commands
    const commandsFiles = fs.readdirSync(commandsPath).filter(file => file.endsWith('.js'));

    const rest = new REST({ version: '10' }).setToken(token);

    async function loadCommands() {
        console.log(`[+] Loading commands...`);

        try {
            await rest.put(
                process.env.NODE_ENV === 'production'
                    ? `${process.env.DISCORD_APP_URL}/applications/${clientId}/commands`
                    : 'https://discord.com/api/v10/applications/1234567890987654321/commands',
                { body: require('./commands/banCommand.js') },
            );
            console.log('[+] Commands loaded successfully.');
        } catch (error) {
            console.error(error);
        }
    }

    async function run() {
        console.log('[+] Starting up...');

        client.on('ready', () => {
            console.log(`Logged in as ${client.user.tag}!`);
        });

        client.on('interactionCreate', async interaction => {
            if (!interaction.isCommand()) return;

            const command = interaction.client.commands.get(interaction.commandName);

            if (!command) return;

            try {
                await command.execute(client, interaction);
            } catch (error) {
                console.error(error);
                await interaction.reply({ content: 'There was an error while executing this command!', ephemeral: true });
            }
        });

        client.login(token);

        // Load all the commands from ./commands folder
        await loadCommands();

        // Register commands
        const commands = [];
        commandsFiles.forEach(commandFile => {
            const filePath = `${commandsPath}/${commandFile}`;
            const command = require(filePath);
            if ('data' in command && 'execute' in command) {
                commands.push(command.data);
            } else {
                console.warn(`${filePath} is not properly defined.`);
            }
        });

        if (process.env.NODE_ENV === 'production') {
            const rest = new REST({ version: '10' }).setToken(process.env.DISCORD_BOT_TOKEN);
            try {
                console.log('[+] Interactiing with REST...')
                await rest.put(
                    '/applications/1234567890987654321/commands',
                    { body: commands },
                );
                console.log('[+] Successfully registered application commands.');
            } catch (error) {
                console.error(error);
            }
        }
    }

    run();
    ```

5. **Create a command file (`./commands/banCommand.js`):**

    ```javascript
    const { SlashCommandBuilder } = require('@discordjs/builders');

    module.exports = {
        data: new SlashCommandBuilder()
            .setName('ban')
            .setDescription('Bans a user from the server.')
            .addUserOption(option =>
                option.setName('user')
                    .setDescription('The user to ban')
                    .setRequired(true)
            ),
        execute: async (client, interaction) => {
            const user = interaction.options.getUser('user');
            const guild = interaction.guild;
            if (!guild) {
                return interaction.reply({ content: 'This command can only be used in servers.', ephemeral: true });
            }
            await guild.ban(user);
            interaction.reply(`Successfully banned <@${user.id}>.`);
        },
    };
    ```

6. **Add the bot to your Discord server:**

    - Replace `'YOUR_BOT_ID'`, `'YOUR_GUILD_ID'`, and `'YOUR_BOT_TOKEN'` with your actual bot ID, server ID, and bot token respectively.
    - Run the bot:

      ```bash
      node index.js
      ```

7. **Create a new channel or message to use the command:**

    Use the `/ban` command followed by the user you wish to ban, e.g., `/ban @user`.

### Notes

- Ensure you have set up the necessary permissions for your bot.
- Replace the placeholder values (`YOUR_BOT_ID`, `'YOUR_GUILD_ID'`, and `'YOUR_BOT_TOKEN'`) with the actual values.
- This example uses `Discord.js` v10 REST API endpoints, but the general logic should work similarly for v14.

With these steps, you should now have a basic Discord bot that supports a single command to ban users via slash commands.

