```c
#include "snake.h"

Snake* init_snake() {
    Snake* s = malloc(sizeof(Snake));
    if (!s) return NULL;

    s->body = malloc(1 * sizeof(Point));
    if (!s->body) {
        free(s);
        return NULL;
    }
    s->length = 1;
    s->body[0].x = 10;  // Starting position
    s->body[0].y = 10;

    return s;
}

void add_tail(Snake* s) {
    Point tail = s->body[s->length - 1];
    s->body = realloc(s->body, (s->length + 1) * sizeof(Point));
    if (!s->body) return;
    s->body[s->length].x = tail.x;
    s->body[s->length].y = tail.y;
    s->length++;
}
```

### Step 5: Implement Game Logic

**snake.c**
```c
#include "snake.h"

void move_snake(Snake* s, int dir) {
    Point head = s->body[0];
    switch (dir) {
        case 'w':
            head.y--;
            break;
        case 's':
            head.y++;
            break;
        case 'a':
            head.x--;
            break;
        case 'd':
            head.x++;
            break;
    }

    // Check for border collision
    if (head.x < 0 || head.x >= SCREEN_WIDTH || head.y < 0 || head.y >= SCREEN_HEIGHT) {
        reset_snake(s);
        return;
    }

    // Check for collision with itself
    for (int i = s->length - 1; i > 0; i--) {
        if (head.x == s->body[i].x && head.y == s->body[i].y) {
            reset_snake(s);
            return;
        }
    }

    // Move the head and the rest of the body
    s->body[0] = head;
    for (int i = 1; i < s->length; i++) {
        s->body[i] = s->body[i - 1];
    }

    // Add tail if food is eaten
    if (head.x == FOOD_X && head.y == FOOD_Y) {
        add_tail(s);
        generate_food(s);
    }
}
