        for (int j = 0; j < SCREEN_WIDTH; j++) {
            mvaddch(i, j, ' ');
        }
    }

    for (int i = 0; i < s->length; i++) {
        mvaddch(snake_pos[i].y, snake_pos[i].x, '#');
    }

    mvprintw(0, 0, "Score: %d", s->length - 1); // -1 because the first segment is the head
}

void generate_food(Snake* s) {
    do {
        s->body[s->length] = (Point){rand() % SCREEN_WIDTH, rand() % SCREEN_HEIGHT};
    } while (contains_body(&s->body[0], s->body, s->length));
}

bool contains_body(const Point* head, const Point* body, int length) {
    for (int i = 0; i < length; i++) {
        if (head->x == body[i].x && head->y == body[i].y) {
            return true;
        }
    }
    return false;
}
