#define OPT_HEIGHT 20

int main(int argc, char *argv[]) {
    char direction;
    WINSIZE ws;
    bool quit = false;

    if (argc != 2) {
        printf("Usage: %s WIDTH\n", argv[0]);
        return 1;
    }

    int width = atoi(argv[1]);
    int height = OPT_HEIGHT;

    if (ioctl(STDOUT_FILENO, TIOCGWINSZ, &ws)) {
        height = ws.ws_row;
    }

    int cell_size = width / OPT_WIDTH;

    initscr();
    cbreak();
    noecho();
    timeout(0);
    keypad(stdscr, true);

    int win_id = newwin(height, width, 0, 0);
    wresize(win_id, height, width);
    refresh();

    Snake* s = init_snake();
    generate_food(s);

    init_game(win_id);
    render_game(win_id, s);

    while (!quit) {
        direction = getch();
        switch (direction) {
            case KEY_UP:
                move_snake(s, 'w');
                break;
            case KEY_DOWN:
                move_snake(s, 's');
